import {
  AppBar,
  Box,
  Menu,
  MenuItem,
  Toolbar,
  Typography,
} from "@mui/material";
import { useState } from "react";
import KeyboardArrowDownSharpIcon from "@mui/icons-material/KeyboardArrowDownSharp";

function Navbar() {
  const creditCardsData = {
    "HDFC Bank Credit Card": [
      "Swiggy Credit Card",
      "Tata Neu Credit Card",
      "HDFC Millennia Credit Card",
      "HDFC Freedom Credit Card",
      "HDFC IndianOil Credit Card",
      "HDFC MoneyBack Credit Card",
      "HDFC UPI RuPay Credit Card",
      "HDFC MoneyBack+ Credit Card",
    ],
    "SBI Credit Card": [
      "SBI Prime Credit Card",
      "SimplyCLICK SBI Card",
      "SBI Elite Credit Card",
      "SimplySave SBI Card",
      "SBI PULSE Credit Card",
      "BPCL SBI Credit Card",
      "IRCTC RuPay Credit Card",
    ],
    "Popular Credit Card": [
      "Pop Club Credit Card",
      "Anq Phi Credit Card",
      "Jupiter Credit Card",
      "OneCard Credit Card",
      "ZET Magnet FD Credit Card",
      "Rupicard Credit Card",
      "Kiwi Credit Card",
    ],
  };

  const loanData = {
    "Personal Loan": [
      "KreditBee Personal Loan",
      "Fibe Personal Loan",
      "HDFC Jumbo Loan",
      "Prefr Personal Loan",
      "Poonawalla Personal Loan",
      "Incred Personal Loan",
      "L&T Finance Personal Loan",
      "HSBC Personal Loan",
      "Freo Loan",
    ],
    "Business Loan": [
      "KreditBee Business Loan",
      "Moneyview Business Loan",
      "Prefr Business Loan",
      "LendingKart Business Loan",
      "IIFL Business Loan",
      "Protium Business Loan",
      "NeoGrowth Business Loan",
      "Faircent Business Loan",
      "SMFG India Business Loan",
      "SBI Business Loan",
    ],
    "Home Loan": [
      "PNB Home Loan",
      "Kotak Bank Home Loan",
      "IDFC First Home Loan",
      "Home First Home Loan",
      "HDFC Bank Home Loan",
      "Federal Bank Home Loan",
      "Bajaj Finserv Home Loan",
      "L&T Home Loan",
    ],
  };

  const [anchorEl, setAnchorEl] = useState(null);
  const [selectedCategory, setSelectedCategory] = useState(null);

  const handleMenuOpen = (event, category) => {
    setAnchorEl(event.currentTarget);
    setSelectedCategory(category);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    setSelectedCategory(null);
  };

  return (
    <AppBar
      sx={{
        backgroundColor: "white",
        boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
        position: "fixed",
      }}
    >
      <Toolbar>
        <img
          src="https://cdn2.mymoneymantra.com/white_logo_d23b343666.webp?format=avif&quality=80&width=195&height=55"
          alt="logo"
          style={{
            filter: "invert(41%) sepia(95%) saturate(5935%) hue-rotate(162deg)",
            marginTop: "20px",
            marginBottom: "20px",
          }}
        />

        <Box sx={{ display: "flex", gap: 7, ml: 2 }}>
          {/* Credit Cards Dropdown */}
          <Box
            onMouseEnter={(event) => handleMenuOpen(event, "Credit Cards")}
            onMouseLeave={handleMenuClose}
            sx={{
              position: "relative",
              cursor: "pointer",
              display: "flex",
              alignItems: "center",
            }}
          >
            <Box sx={{ display: "flex", gap: 0.5, alignItems: "center" }}>
              <Typography
                sx={{ color: "#0097a7", fontWeight: 700, fontSize: "16px" }}
              >
                Credit Cards
              </Typography>
              <KeyboardArrowDownSharpIcon
                sx={{ fontSize: "20px", color: "#0097a7" }}
              />
            </Box>
            <Menu
              anchorEl={anchorEl}
              open={Boolean(anchorEl) && selectedCategory === "Credit Cards"}
              onClose={handleMenuClose}
              MenuListProps={{ onMouseLeave: handleMenuClose }}
              sx={{ mt: 1, "& .MuiPaper-root": { width: "300px" } }}
            >
              {Object.keys(creditCardsData).map((category, index) => (
                <MenuItem
                  key={index}
                  onClick={handleMenuClose}
                  sx={{ color: "#0097a7", fontWeight: 300, fontSize: "16px" }}
                >
                  {category}
                </MenuItem>
              ))}
            </Menu>
          </Box>

          {/* Loans Dropdown */}
          <Box
            onMouseEnter={(event) => handleMenuOpen(event, "Loans")}
            onMouseLeave={handleMenuClose}
            sx={{
              position: "relative",
              cursor: "pointer",
              display: "flex",
              alignItems: "center",
            }}
          >
            <Box sx={{ display: "flex", gap: 0.5, alignItems: "center" }}>
              <Typography
                sx={{ color: "#0097a7", fontWeight: 700, fontSize: "16px" }}
              >
                Loans
              </Typography>
              <KeyboardArrowDownSharpIcon
                sx={{ fontSize: "20px", color: "#0097a7" }}
              />
            </Box>
            <Menu
              anchorEl={anchorEl}
              open={Boolean(anchorEl) && selectedCategory === "Loans"}
              onClose={handleMenuClose}
              MenuListProps={{ onMouseLeave: handleMenuClose }}
              sx={{ mt: 1, "& .MuiPaper-root": { width: "300px" } }}
            >
              {Object.keys(loanData).map((category, index) => (
                <MenuItem
                  key={index}
                  onClick={handleMenuClose}
                  sx={{ color: "#0097a7", fontWeight: 300, fontSize: "16px" }}
                >
                  {category}
                </MenuItem>
              ))}
            </Menu>
          </Box>

          {/* Other Links */}
          {["Insurance", "EMI Calculator", "Credit Score", "Blogs"].map(
            (item) => (
              <Typography
                key={item}
                sx={{
                  color: "#0097a7",
                  fontWeight: 700,
                  fontSize: "16px",
                  cursor: "pointer",
                  transition: "color 0.3s",
                }}
              >
                {item}
              </Typography>
            )
          )}
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
